import * as React from 'react';
import { images, icons, COLORS, FONTS } from '../constants';
import { Tab, Divider, SearchBar, Header, Icon, Card, ListItem, Avatar, Image } from 'react-native-elements';
import {
    StyleSheet,
    View,
    Text,
    TouchableOpacity
} from 'react-native';
const list = [
    //Dummy Data
    {
        name: 'Ihtesham ',
        avatar_url: images.onboardingImage,
        subtitle: 'Family Lawyer'
    },
    {
        name: 'Ihtesham Mansoor',
        avatar_url: images.onboardingImage,
        subtitle: 'Family Lawyer'
    },
    {
        name: 'Ihtesham Mansoor',
        avatar_url: images.onboardingImage,
        subtitle: 'Family Lawyer'
    },

    {
        name: 'HARIS KAYANI',
        avatar_url: images.onboardingImage,
        subtitle: 'Legel Lawyer'
    },

]
export default class App extends React.Component {
    state = {
        search: '',
    };

    updateSearch = (search) => {
        this.setState({ search });
    };

    render() {
        const { search } = this.state;
        return (
            <View style={styles.container}>
                <Divider style={{ width: "50%", margin: -5 }} />
                <Header
                    containerStyle={{ width: 400 }}
                    leftComponent={{ text: "", style: { color: 'black', fontSize: 20 } }}
                    placement="left"
                />
                <Card containerStyle={{ backgroundColor: "#003f5c" }} wrapperStyle={{}} >
                    <Card.Title style={{ color: COLORS.white, ...FONTS.h3 }}>Profile</Card.Title>
                    <Card.Divider />
                    <View>
                        <Image
                            containerStyle={{}}
                            onLongPress={() => console.log("onLongPress()")}
                            placeholderStyle={{}}
                            transitionDuration={1000}
                            source={{
                                uri:
                                    "https://user-images.githubusercontent.com/5962998/65694309-a825f000-e043-11e9-8382-db0dba0851e3.png"
                            }}
                            style={{ width: 200, height: 200 }}
                        />

                    </View>
                    <Text style={{ color: COLORS.white, ...FONTS.h3 }}>  </Text>
                    <Text style={{ color: COLORS.white, ...FONTS.h3 }}>  </Text>
                    <Text style={{ color: COLORS.white, ...FONTS.h3 }}>Name : </Text>
                    <Text style={{ color: COLORS.white, ...FONTS.h3 }}>  </Text>
                    <Text style={{ color: COLORS.white, ...FONTS.h3 }}>Email : </Text>
                    <Text style={{ color: COLORS.white, ...FONTS.h3 }}>  </Text>
                    <Text style={{ color: COLORS.white, ...FONTS.h3 }}>Contact No.  : </Text>
                    <Text style={{ color: COLORS.white, ...FONTS.h3 }}>  </Text>
                    <Text style={{ color: COLORS.white, ...FONTS.h3 }}>Address : </Text>
                    <Text style={{ color: COLORS.white, ...FONTS.h3 }}>  </Text>
                    <Text style={{ color: COLORS.white, ...FONTS.h3 }}>Password : </Text>
                </Card>

            </View>
        );
    }
}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: "#003f5c",
    },
    shadow: {
        shadowColor: "#000",
        shadowOffset: {
            width: 0,
            height: 2,
        },
        shadowOpacity: 0.25,
        shadowRadius: 3.84,

        elevation: 5,
    }
});
